import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import InicioTurmas from './components/inicioTurmas.js';
import Login from './components/Login'; 

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} /> {/* Redireciona para a página de Login */}
        <Route path="/turmas" element={<InicioTurmas />} /> {/* Rota para a página de Início das Turmas */}
      </Routes>
    </Router>
  );
}

export default App;
